import {StyleSheet} from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#f0f0f7'
    },

    teacherList: {
        marginTop: -40
    },

    searchForm: {
        marginBottom: 24,
    },

    label: {
        color: 'd4c2ff',
        fontFamily: 'Poppins_400Regular'
    }
})

export default styles;
